import { DefaultTheme } from "styled-components";

export const theme: DefaultTheme = {
    bgColor: "#2f3640",
    textColor: "#f5f6fa",
    accentColor: "#44bd32",
};

export const darkTheme: DefaultTheme = {
    bgColor: "#333",
    textColor: "#fff",
    accentColor: "#44bd32",
};

export const lightTheme: DefaultTheme = {
    bgColor: "#fff",
    textColor: "#333",
    accentColor: "#44bd32",
};
